import './App.css';
import { Button, Box, Card, CardContent, Container, Typography } from '@material-ui/core/';
import { makeStyles } from '@material-ui/styles'
import { BrowserRouter as Router, Route, Routes} from 'react-router-dom'; 
import { Contact } from './contact.js'
import { Hem } from './hem.js'
import { PostList } from './postlist.js'
import { SinglePost } from './singlePost.js'
import { MusikList } from './musik.js'
import background_image from "./images/light_gray_background.jpg"
import ButtonAppBar from './navBar';
import React from "react";




function App() {

//const isActive = useMediaQuery("max-width: 1000px");


const cardMainWidth = "750px";
const drawerWidth="300px";
const drawerMarginTop="300px";

const useStyles = makeStyles((theme) => ({
  container: {
    /*margin: "-8px",
    padding: "0",
    backgroundImage: `url(${background_image})`,
    backgroundRepeat: "repeat",
    backgroundSize: "cover",
    minWidth: '100gitvw',*/
    //minHeight: '98vh', 
    margin: '0',
    display:"inline-flex",
    flexDirection: "row",
    justifyContent: "center",
  },
  mainDiv: {
    textAlign: "center",
  },
  root: {
    display:"inline-flex",
    flexDirection: "row",
    justifyContent: "center",
  },
  boxLeft: {
    marginTop: "20px",
  },
  cardMain: {
    backgroundColor: "f2f2f2",
    maxWidth: cardMainWidth,
    marginLeft: "20px",
    marginRight: "20px",
    padding: "0",
    height: "900px",
  },
  cardProfile: {
    maxWidth: drawerWidth,
    height: '200px',
    marginTop:"0px" 
  },
  cardLeft: {
    backgroundColor: "#f2f2f2",
    width: drawerWidth,
    marginTop:drawerMarginTop,
    ['@media (max-width:1300px)']: {
      display: 'none'
    }
  },
  cardRight: {
    backgroundColor: "#f2f2f2",
    width: drawerWidth,
    marginTop: drawerMarginTop,
    maxHeight: "400px",
    ['@media (max-width:1300px)']: {
      display: 'none'
    }
  },
  cardContentMain : {
    margin: '0',
    padding: '0'
  },
  buttonCard : {
    padding: "10px",
    margin: "2px",
    size: "large",
    width: "180px",
    height: "50px",
    color: "white",
    backgroundColor: "#737373"
  },
  buttonMini : {
    padding: "10px",
    margin: "2px",
    size: "large",
    width: "100px",
    height: "50px",
    color: "white",
    backgroundColor: "#737373"
  },
  image : {
    marginTop: "10px",
    maxWidth : "100%"
  },
  imgProfile : {
    marginTop: "10px",
    maxWidth : "60%"
      },
  imgHeader : {
    width : cardMainWidth ,
    height : "200px",
    objectFit: "cover",
    ['@media (max-width:1200px)']: {
      maxWidth: '100vh'
    }

      },
  headerText : {
    paddingTop: "20px",
    fontFamily: "monospace",
    color: "rgb(0,0,66)"
  },
  navBar : {
    display: "inline-flex",
    flexDirection: "row",
    justifyContent: 'flex-start',
    ['@media (min-width:1300px)']: {
      display: 'none'
    }
  }  
}))

const classes = useStyles();
return (
    <Router>
      <div className={classes.mainDiv}>
      <Container className={classes.container}>

      <Box className={classes.root}>

      <Box className={classes.boxLeft}>
        {/* <Card className={classes.cardProfile}>
          <CardContent>
            <Typography>Fredrik Fischer</Typography>
            <img className={classes.imgProfile} src="../images/profilbild_test.jpg"></img>
          </CardContent>
        </Card> */}
        <Card className={classes.cardLeft}>
          <CardContent>
            <Button onClick={event =>  window.location.href='/'} className={classes.buttonCard}>Hem</Button>
            <Button onClick={event =>  window.location.href='/musik/'} className={classes.buttonCard}>Musik</Button>
            <Button onClick={event =>  window.location.href='/posts/'} className={classes.buttonCard}>Inlägg</Button>
            <Button onClick={event =>  window.location.href='/contact'} className={classes.buttonCard}>Kontakt</Button>
          </CardContent>
        </Card>
      </Box>

      <Card className={classes.cardMain}>
        <CardContent className={classes.cardContentMain}> 
        <img className={classes.imgHeader} src="../images/Header-website.png"></img>

          <CardContent className={classes.navBar}>
            <Button onClick={event =>  window.location.href='/'} className={classes.buttonMini}>Hem</Button>
            <Button onClick={event =>  window.location.href='/musik/'} className={classes.buttonMini}>Musik</Button>
            <Button onClick={event =>  window.location.href='/posts/'} className={classes.buttonMini}>Inlägg</Button>
            <Button onClick={event =>  window.location.href='/contact'} className={classes.buttonMini}>Kontakt</Button>
          </CardContent>

        {/* {<ButtonAppBar className={classes.navBar}/>}  */}
        {/* {<PostList/>} */}


          <Routes>
            <Route exact path="/" element={<Hem/>}/>
            {/* <Route path="/:topic" element={<Topic/>}/> */}
            <Route path="/posts/:id" element={<SinglePost />}/>
            <Route path="/posts/" element={<PostList/>}/>
            <Route path="/contact" element={<Contact/>}/>
            <Route path="/musik" element={<MusikList/>}/>           
          </Routes>
        </CardContent>
      </Card>



     <Card className={classes.cardRight}>
      <CardContent>
      <Typography>Sidan är under konstruktion</Typography>

      </CardContent>
     </Card>

      </Box>
      </Container>


    </div>
    </Router>
  );
}

export default App;
